import React, { useEffect, useState } from "react";

const Users = () => {
  const [users, setUsers] = useState([]);
  useEffect(() => {
    try {
      fetch(`${BASE_URL}/${USERS}`)
        .then((res) => res.json())
        .then((data) => setUsers(data));
    } catch (error) {}
  }, []);
  return <div>users</div>;
};

export default Users;
